import React from "react";
import {useQuery} from "react-query";

type messageType = {
    id: string,
    message: string,
    userName: string
    messageTime: string
}

export function MessageList() {

    const {data: messages, isLoading} = useQuery({
        queryFn: async () => {
            const response = await fetch("http://localhost:8080/chat/messages",{mode: "no-cors"});
            return await response.json();
        },
        queryKey: ["data"]
    });
    if (isLoading) return (
        <div>Loading...</div>
    )

    return <div>
        <ul>
            {messages?.map((message: messageType) => (
                <li key={message.id}>
                    <div>
                        <h5>{message.userName}</h5>
                        <p>{message.message}</p>
                    </div>
                </li>
            ))}
        </ul>
    </div>
}
